import React, { useContext } from 'react';
import './Doctor.css';
import { AdminContext } from '../../context/AdminContext';

const Doctor = ({image, name, speciality, available, id}) => {
  const {changeAvailability} = useContext(AdminContext);
  return (
    <div className='doctor'>
      <div className='img'>
        <img src={image} alt=''/>
      </div>
      <div className='text p-3'>  
        <p className='mb-2 name'>{name}</p>
        <p className='mb-2 speciality'>{speciality}</p>
        <div className='d-flex gap-2 align-items-center'>
          <input onChange={()=>changeAvailability(id)} type='checkbox' checked={available}/>
          <p className='available'>Available</p>
        </div>
      </div>
    </div>
  )
}

export default Doctor
